import styled from "styled-components";

const SHeaderContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-bottom: 20px;
  img {
    width: 100px;
    height: 100px;
  }
  span {
    font-size: 14px;
  }
`;

function HeaderContainer() {
  return (
    <SHeaderContainer>
      <img src={require("../../images/logo2.png")} alt="logo" />
    </SHeaderContainer>
  );
}

export default HeaderContainer;
